style.css:
@-moz-document domain("ducs.google.com") {
* {
		font-family: "Arial Rounded MT Bold", Arial, Helvetica, sans-serif;
	}
	body {
		background: #000000 !important;
		color: #ffcc99 !important;
	}
	body[class] {
		background: #000000 !important;
		color: #ffcc99 !important;
	}
	[id=docs-chrome] {
		background: #000000 !important;
		color: #ffcc99 !important;
	}
	[id=docs-editor],
	[id=docs-header],
	[id=docs-bars],
	[id=docs-titlebar],
	[id=docs-toolbar-wrapper],
	[id=docs-primary-toolbars],
	[id=docs-side-toolbar],
	.left-sidebar-container-content
	{
		background: #000000 !important;
		color: #ffcc99 !important;
	}
	[id=docs-editor-container] {
		background: #000000 !important;
		color: #ffcc99 !important;
	}
	body.docs-body-pageless {
		background: #000000 !important;
		color: #ffcc99 !important;
	}
	body.docs-hub {
		background: #000000 !important;
		color: #ffcc99 !important;
	}
	.docs-titlebar-buttons {
		background: #000000 !important;
	}
	.jfk-button-standard {
		color: #ffcc99;
	}
}
